import React from 'react';

class GetStartedBtn extends React.Component {
    render(){

        const getStartedBtnStyle = {
            background:'#4BD575'
        }
        const getStartedBtnStyleHover = {
            background:'#4BD575'
        }
        return(
            <button style={getStartedBtnStyle} onMouseOver={this.style=getStartedBtnStyleHover} onMouseLeave={this.style=getStartedBtnStyle}>Get Started</button>        
            )
    }
}

export default GetStartedBtn;
